var tipuesearch = {"pages": [{'title': 'About', 'text': '\n 40823223 倉儲： https://github.com/40823223/cd2021 \n', 'tags': '', 'url': 'About.html'}, {'title': '筆記', 'text': '1.在github建立倉儲，git clone到近端 \n 2.參考\xa0 https://github.com/mdecourse/newcms ，加入除cmsimde目錄外的所有內容 \n 以git子模塊添加\xa0 https://github.com/mdecourse/cmsimde  \xa0cmsimde \n 建立cmsimde目錄，並從github取下子模組內容。 \n 3.在近端維護時，將目錄更改為到倉庫中的cmsimde，以python wsgi.py啟動近端網際伺服器。 \n 動態內容編輯完成後，以generate_pages轉為靜態內容，以git add commit以及push將內容推到更長。 \n 4.之後若要以git clone取下包含submodule的所有內容，執行： \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git', 'tags': '', 'url': '筆記.html'}]};